import React from 'react';
import { Link } from 'react-router-dom'

import './Home.css';

class Home extends React.Component {

    render() {
        return (
            <div className="Home">
                Home
                <br />
                <button component={Link} to="/game">
                    go to Game
                </button>
            </div>
        );
    }
}

export default Home;
